import React from "react";
import ReactDOM from "react-dom";
import Users from "./Users";

import "./styles.css";

function App() {
  return (
    <div className="App">
      <h1>User Management</h1>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
